The World Health Organization (WHO) is a specialized agency of the United Nations responsible for international public health. The WHO Constitution states its main objective as "the attainment by all peoples of the highest possible level of health". The WHO was established on 7 April 1948. The WHO incorporated the assets, personnel, and duties of the League of Nations' Health Organization and the , including the International Classification of Diseases (ICD). The WHO's mandate seeks and includes: working worldwide to promote health, keeping the world safe, and serve the vulnerable. It provides technical assistance to countries, sets international health standards, and collects data on global health issues. The WHO has played a leading role in several public health achievements, most notably the eradication of smallpox, the near-eradication of polio, and the development of an Ebola vaccine. Its current priorities include communicable diseases, particularly HIV/AIDS, Ebola, COVID-19, malaria and tuberculosis; non-communicable diseases such as heart disease and cancer; healthy diet, nutrition, and food security; occupational health; and substance abuse. The director-general is Tedros Adhanom Ghebreyesus of Ethiopia. Among the largest contributors were Germany (which contributed 12.18% of the budget), the Bill & Melinda Gates Foundation (11.65%), and the United States (7.85%). The first conference, in Paris, was almost solely concerned with cholera, which would remain the disease of major concern for the ISC for most of the 19th century. Seven of these international conferences, spanning 41 years, were convened before any resulted in a multi-state international agreement. The seventh conference, in Venice in 1892, finally resulted in a convention. Five years later, in 1897, a convention concerning the bubonic plague was signed by sixteen of the 19 states attending the Venice conference. While Denmark, Sweden-Norway, and the USA did not sign this convention, it was unanimously agreed that the work of the prior conferences should be codified for implementation. Subsequent conferences, from 1902 until the final one in 1938, widened the diseases of concern for the ISC, and included discussions of responses to yellow fever, brucellosis, leprosy, tuberculosis, and typhoid. In part as a result of the successes of the Conferences, the Pan-American Sanitary Bureau (1902), and the  (1907) were soon founded. When the League of Nations was formed in 1920, they established the Health Organization of the League of Nations. Establishment
During the 1945 United Nations Conference on International Organization, Szeming Sze, a delegate from China, conferred with Norwegian and Brazilian delegates on creating an international health organization under the auspices of the new United Nations. After failing to get a resolution passed on the subject, Alger Hiss, the secretary general of the conference, recommended using a declaration to establish such an organization. The constitution of the World Health Organization was signed by all 51 countries of the United Nations, and by 10 other countries, on 22 July 1946. It thus became the first specialized agency of the United Nations to which every member subscribed. Its constitution formally came into force on the first World Health Day on 7 April 1948, when it was ratified by the 26th member state. Andrija Štampar was the Assembly's first president, and G. Brock Chisholm was appointed director-general of WHO, having served as executive secretary during the planning stages. Its first priorities were to control the spread of malaria, tuberculosis and sexually transmitted infections, and to improve maternal and child health, nutrition and environmental hygiene. They believe WHO must regain what they see as independence. (In most areas, the programme goals became control instead of eradication.) WHO established a network of consultants who assisted countries in setting up surveillance and containment activities. The WHO also helped contain the last European outbreak in Yugoslavia in 1972. 1975: The WHO launched the Special Programme for Research and Training in Tropical diseases (the TDR). Co-sponsored by UNICEF, UNDP, and the World Bank, it was established in response to a 1974 request from the WHA for an intensive effort to develop improved control of tropical diseases. Two years later preventing discrimination against sufferers was attended to and in 1996 the Joint United Nations Programme on HIV/AIDS (UNAIDS) was formed. The ICCDE recommends to WHO which countries fulfill requirements for certification. 1998: WHO's Director-General highlighted gains in child survival, reduced infant mortality, increased life expectancy and reduced rates of "scourges" such as smallpox and polio on the fiftieth anniversary of WHO's founding. 2002: The Global Fund to Fight AIDS, Tuberculosis and Malaria was drawn up to improve the resources available. 2016: Following the perceived failure of the response to the West Africa Ebola outbreak, the World Health Emergencies programme was formed, changing the WHO from just being a "normative" agency to one that responds operationally to health emergencies. The WHO fulfills this objective through its functions as defined in its Constitution:
(a) To act as the directing and coordinating authority on international health work;
(b) To establish and maintain effective collaboration with the United Nations, specialized agencies, governmental health administrations, professional groups and such other organizations as may be deemed appropriate;
(c) To assist Governments, upon request, in strengthening health services;
(d) To furnish appropriate technical assistance and, in emergencies, necessary aid upon the request or acceptance of Governments;(e) To provide or assist in providing, upon the request of the United Nations, health services and facilities to special groups, such as the peoples of trust territories; (f) To establish and maintain such administrative and technical services as may be required, including epidemiological and statistical services;(g) to stimulate and advance work to eradicate epidemic, endemic and other diseases; (h) To promote, in co-operation with other specialized agencies where necessary, the prevention of accidental injuries;
(i) To promote, in co-operation with other specialized agencies where necessary, the improvement of nutrition, housing, sanitation, recreation, economic or working conditions and other aspects of environmental hygiene; (j) To promote co-operation among scientific and professional groups which contribute to the advancement of health; (k) To propose conventions, agreements and regulations, and make recommendations with respect to international health matters and to perform. , the World Health Organization has worked within the UNAIDS network and strives to involve sections of society other than health to help deal with the economic and social effects of HIV/AIDS. In line with UNAIDS, WHO has set itself the interim task between 2009 and 2015 of reducing the number of those aged 15–24 years who are infected by 50%; reducing new HIV infections in children by 90%; and reducing HIV-related deaths by 25%. At the time, the World Health Assembly President, Guyana's Health Minister Leslie Ramsammy, condemned Pope Benedict's opposition to contraception, saying he was trying to "create confusion" and "impede" proven strategies in the battle against the disease. During the 1970s, WHO had dropped its commitment to a global malaria eradication campaign as too ambitious, it retained a strong commitment to malaria control. These include engaging national governments and their financing, early diagnosis, standardising treatment, monitoring of the spread and effect of tuberculosis, and stabilising the drug supply. It has also recognized the vulnerability of victims of HIV/AIDS to tuberculosis. the World Health Organization (WHO) stated the eradication programme has saved millions from deadly disease. This response was only possible because of the extensive preparations undertaken during the last decade". Through the WHO Expert Committee on Drug Dependence (ECDD), it can recommend changes to scheduling of substances to the United Nations Commission on Narcotic Drugs. The WHO works to improve nutrition, food safety and food security and to ensure this has a positive effect on public health and sustainable development. The situation in West Africa was considered very serious. Reform efforts following the Ebola outbreak
Following the 2014 Ebola outbreak in West Africa, the organization was heavily criticized for its bureaucracy, insufficient financing, regional structure, and staffing profile. An internal WHO report on the Ebola response pointed to underfunding and the lack of "core capacity" in health systems in developing countries as the primary weaknesses of the existing system. At the annual World Health Assembly in 2015, Director-General Margaret Chan announced a $100 million Contingency Fund for rapid response to future emergencies, of which it had received $26.9 million by April 2016 (for 2017 disbursement). WHO has budgeted an additional $494 million for its Health Emergencies Programme in 2016–17, for which it had received $140 million by April 2016. The program was aimed at rebuilding WHO capacity for direct action, which critics said had been lost due to budget cuts in the previous decade that had left the organization in an advisory role dependent on member states for on-the-ground activities. While organizing the global response to the COVID-19 pandemic and overseeing "more than 35 emergency operations" for cholera, measles and other epidemics internationally, the WHO has been criticized for praising China's public health response to the crisis while seeking to maintain a "diplomatic balancing act" between the United States and China. On 14 April 2020, United States President Donald Trump said that he would halt United States funding to the WHO while reviewing its role in "severely mismanaging and covering up the spread of the coronavirus." World leaders and health experts largely condemned President Trump's announcement, which came amid criticism of his response to the outbreak in the United States. On 8 May 2020, the United States blocked a vote on a U.N. Security Council resolution aimed at promoting nonviolent international cooperation during the pandemic, and mentioning the WHO. On 7 July 2020, President Trump formally notified the UN of his intent to withdraw the United States from the WHO. However, Trump's successor, President Joe Biden, canceled the planned withdrawal and announced in January 2021 that the U.S. would resume funding the organization. Other international policy frameworks produced by WHO include the International Code of Marketing of Breast-milk Substitutes (adopted in 1981), Framework Convention on Tobacco Control (adopted in 2003) the Global Code of Practice on the International Recruitment of Health Personnel (adopted in 2010) as well as the WHO Model List of Essential Medicines and its pediatric counterpart. WHO collaborates with The Global Fund to Fight AIDS, Tuberculosis and Malaria, UNITAID, and the United States President's Emergency Plan for AIDS Relief to spearhead and fund the development of HIV programs. As part of the United Nations, the World Health Organization supports work towards the Millennium Development Goals. Of the eight Millennium Development Goals, three – reducing child mortality by two-thirds, to reduce maternal deaths by three-quarters, and to halt and begin to reduce the spread of HIV/AIDS – relate directly to WHO's scope; the other five inter-relate and affect world health. The information gathered in this portal is used by the countries to set priorities for future strategies or plans, implement, monitor, and evaluate it. The Pan American Health Organization (PAHO/AMRO) became the first region to develop and pass a policy on research for health approved in September 2009. It also contains important international documents and information. In the draft, the World Health Organization outlines its commitment to ending the AIDS epidemic by the year 2030 with interim targets for the year 2020. To make achievements towards these targets, the draft lists actions that countries and the WHO can take, such as a commitment to universal health coverage, medical accessibility, prevention and eradication of disease, and efforts to educate the public. Some notable points made in the draft include addressing gender inequity where females are nearly twice as likely as men to get infected with HIV and tailoring resources to mobilized regions where the health system may be compromised due to natural disasters, etc. Membership

, the WHO has 194 member states: all member states of the United Nations except for Liechtenstein (192 countries), plus the Cook Islands and Niue. A state becomes a full member of WHO by ratifying the treaty known as the Constitution of the World Health Organization. and January 2021, it also had two associate members, Puerto Rico and Tokelau. Several other countries have been granted observer status. Palestine is an observer as a "national liberation movement" recognized by the League of Arab States under United Nations Resolution 3118. The government of Taiwan was allowed to participate under the designation "Chinese Taipei" as an observer from 2009 to 2016, but has not been invited again since. WHO member states appoint delegations to the World Health Assembly, the WHO's supreme decision-making body. All UN member states are eligible for WHO membership, and, according to the WHO website, "other countries may be admitted as members when their application has been approved by a simple majority vote of the World Health Assembly". The World Health Assembly is attended by delegations from all member states, and determines the policies of the organization. In addition, the UN observer organizations International Committee of the Red Cross and International Federation of Red Cross and Red Crescent Societies have entered into "official relations" with WHO and are invited as observers. In the World Health Assembly, they are seated alongside the other NGOs. In May 2009, the Department of Health of the Republic of China was invited by the WHO to attend the 62nd World Health Assembly as an observer under the name "Chinese Taipei". Its participation with WHO ended due to diplomatic pressure from the PRC following the election in 2016 that brought the independence-minded Democratic Progressive Party back into power. Political pressure from the PRC has led to the ROC being barred from membership of the WHO and other UN-affiliated organizations, and in 2017 to 2020 the WHO refused to allow Taiwanese delegates to attend the WHO annual assembly. According to Taiwanese publication The News Lens, on multiple occasions Taiwanese journalists have been denied access to report on the assembly. In May 2018, the WHO denied access to its annual assembly by Taiwanese media, reportedly due to demands from the PRC. The United States, Japan, Germany, and Australia all support Taiwan's inclusion in WHO. During the outbreak Canadian Prime Minister Justin Trudeau voiced his support for Taiwan's participation in WHO, as did Japanese Prime Minister Shinzo Abe. In January 2020 the European Union, a WHO observer, backed Taiwan's participation in WHO meetings related to the coronavirus pandemic as well as their general participation. In a 2020 interview, assistant director-general Bruce Aylward appeared to dodge a question from RTHK reporter Yvonne Tong about Taiwan's response to the pandemic and inclusion in the WHO, blaming internet connection issues. He responded by indicating that they had already discussed China and formally ended the interview. This incident led to accusations about the PRC's political influence over the international organization. In early May 2020, New Zealand Foreign Minister Winston Peters expressed support for the ROC's bid to rejoin the WHO during a media conference. On 9 May, Congressmen Eliot Engel, the Democratic chairman of the United States House Committee on Foreign Affairs, Michael McCaul, the House Committee's ranking Republican member, Senator Jim Risch, the Republican chairman of the United States Senate Committee on Foreign Relations, and Senator Bob Menendez, the Senate Committee's ranking Democratic member, submitted a joint letter to nearly 60 "like-minded" countries including Canada, Thailand, Japan, Germany, the United Kingdom, Saudi Arabia, and Australia, urging them to support ROC's participation in the World Health Organization. It appoints the director-general every five years and votes on matters of policy and finance of WHO, including the proposed budget. Director-General

The head of the organization is the director-general, elected by the World Health Assembly. The current director-general is Dr. Tedros Adhanom Ghebreyesus, who was appointed on 1 July 2017. For example, Palestine attends meetings of the Eastern Mediterranean Regional Office. Each regional committee of the WHO consists of all the Health Department heads, in all the governments of the countries that constitute the Region. The organization has previously instigated the Framework Convention on Tobacco Control in 2003. On 21 October 2017, the Director-General Tedros Adhanom Ghebreyesus appointed the then Zimbabwean president Robert Mugabe as a WHO Goodwill Ambassador to help promote the fight against non-communicable diseases. The appointment attracted widespread condemnation and criticism in WHO member states and international organizations due to Robert Mugabe's poor record on human rights and presiding over a decline in Zimbabwe's public health. Country and liaison offices
The World Health Organization operates 150 country offices in six different regions. It also operates several liaison offices, including those with the European Union, United Nations and a single office covering the World Bank and International Monetary Fund. There will generally be one WHO country office in the capital, occasionally accompanied by satellite-offices in the provinces or sub-regions of the country in question. The country office is headed by a WHO Representative (WR). , the only WHO Representative outside Europe to be a national of that country was for the Libyan Arab Jamahiriya ("Libya"); all other staff was international. WHO Representatives in the Region termed the Americas are referred to as PAHO/WHO Representatives. In Europe, WHO Representatives also serve as head of the country office, and are nationals except for Serbia; there are also heads of the country office in Albania, the Russian Federation, Tajikistan, Turkey, and Uzbekistan. The country office consists of the WR, and several health and other experts, both foreign and local, as well as the necessary support staff. The main functions of WHO country offices include being the primary adviser of that country's government in matters of health and pharmaceutical policies. Financing and partnerships

