The WHO is financed by contributions from member states and outside donors. As of 2020, the biggest contributor is the United States, which gives over $400 million annually. U.S. contributions to the WHO are funded through the U.S. State Department's account for Contributions to International Organizations (CIO). In April 2020, U.S. President Donald Trump, supported by a group of members of his party, announced that his administration would halt funding to the WHO. Funds previously earmarked for the WHO were to be held for 60–90 days pending an investigation into WHO's handling of the COVID-19 pandemic, particularly in respect to the organization's purported relationship with China. The announcement was immediately criticized by world leaders including António Guterres, the secretary general of the United Nations; Heiko Maas, the German foreign minister; and Moussa Faki Mahamat, African Union chairman. On 16 May, U.S. President Donald Trump and his administration agreed to pay up to what China pays in Assessed contributions, which is less than about one-tenth of its previous funding. , the largest annual assessed contributions from member states came from the United States ($110 million), Japan ($58 million), Germany ($37 million), United Kingdom ($31 million) and France ($31 million). According to The Associated Press, the WHO routinely spends about $200 million a year on travel expenses, more than it spends to tackle mental health problems, HIV/AIDS, Tuberculosis and Malaria combined. In 2016, Margaret Chan, director-general of WHO from January 2007 to June 2017, stayed in a $1000-per-night hotel room while visiting West Africa. To do so, OCHA has begun deploying Humanitarian Coordinators and Country Teams to provide a solid architecture for the international community to work through. The United Nation's Children's Fund (UNICEF) was created by the UN to provide food, clothing and healthcare to European children facing famine and disease in the immediate aftermath of World War II. After the UN General Assembly extended UNICEF's mandate indefinitely in 1953, it actively worked to help children in extreme poverty 

 The United Nations oversees 14 peacekeeping operations around the world. UN peacekeeping supports global and national security at a fraction of what it would cost to send in U.S. personnel – eight times more economical according to the Government Accountability Office (GAO). They draw upon the economic and human resources of UN Member States, allowing the U.S. to share the burden of protecting global peace and security and reducing the need for the U.S. to send their own military troops to volatile regions. The Better World Campaign helps promote greater U.S. assistance to UN peacekeeping operations in order to strengthen each mission's capabilities in logistics, training, doctrine, and management expertise. The United Nations (UN) plays a crucial role in promoting social justice and advocating for global health initiatives. The UN was established in 1945 with the goal of maintaining international peace, developing friendly relations between nations, and promoting better standards of living, including conquering hunger, disease, and illiteracy. There are currently 193 member states in the UN. One of the ways the UN promotes social justice is through its support of the Sustainable Development Goals (SDGs). These goals encompass a wide range of issues, including poverty reduction, quality education, gender equality, climate action, and good health and well-being. The UN also actively engages philanthropies and civil society in global health initiatives. Through partnerships with various charitable and governmental organizations, the UN supports initiatives such as training local surgical teams and establishing specialty surgical hospitals. In summary, the UN promotes social justice and advocates for global health initiatives through its support of the Sustainable Development Goals, engagement of philanthropies and civil society, and partnerships with different organizations. By addressing various aspects of development and working towards improving access to healthcare, the UN strives to create a more equitable and healthier world for all. United Nations (UN) peacekeeping missions involving Pakistan cover about 70 operations throughout different parts of the world. Pakistan joined the United Nations on 30 September 1947, despite opposition from Afghanistan because of the Durand Line issue. The Pakistan Armed Forces are the third largest contributor of troops towards UN peacekeeping efforts, behind India and Ethiopia. Peacekeeping, as defined by the United Nations, is the practice of helping countries torn by conflict create conditions for sustainable peace. Such assistance comes in many forms, including confidence-building measures, power-sharing arrangements, electoral support, strengthening the rule of law, and economic and social development. Pakistan's contributions have consisted mainly of regular military personnel, but also include paramilitary troops and civilian police officers as peacekeepers. All operations must include the resolution of conflicts through the use of force to be considered valid under the charter of the United Nations.
